import React from 'react';
import './App.css';
import { Home, CreateWodRoute } from './routes';
import {
  BrowserRouter,
  Switch,
  Route
} from "react-router-dom";
import { NotFound,Dashboard } from './components';
function App() {
    return (
      <div>
        <BrowserRouter>
        {/* BrowserRouter doit avoir uniquement un enfant direct */}
        <div>
          <Switch>
            <Route path="/" exact Component={Home}></Route>
            <Route path="/create/wod" exact Component={CreateWodRoute}></Route>
            <Route component={NotFound}></Route>
          </Switch>

        </div>

        </BrowserRouter>
      </div>
    );
}

export default App;
